function JoinAgree() {
  return (
    <>
      <div className="body">
        <section className="wrap">
        <div className="logo" style={
          {
            backgroundImage:`url(${Logo})`,
            width: '200px',
            height: '170px',
            backgroundSize: 'cover'
          }
        }></div>
        <div className="all-ck">
          <input type="checkbox" />
        </div>
        </section>

      </div>
    </>
  );
}

export default JoinAgree;
